import {
  IndividualCard,
  ImageWrapper,
  ProductImage,
  ParaTag,
  HeadingTag,
} from "./styles";

import { FaStar } from "react-icons/fa";
import { productDetails } from "../../data/String";

function SearchDisplay({ id, name, brand, price, rating, image }: any) {
  if (!name && !price && !brand && !image && !rating)
    return <div>{productDetails.message}</div>;
  else {
    return (
      <IndividualCard>
        <ImageWrapper>
          <ProductImage src={image} />
        </ImageWrapper>
        <HeadingTag>{name}</HeadingTag>
        <ParaTag>Brand:{brand}</ParaTag>
        <ParaTag>${price}</ParaTag>
        <ParaTag>
          <FaStar /> {rating}
        </ParaTag>
      </IndividualCard>
    );
  }
}
export default SearchDisplay;
